import React from 'react';
import { Box, List, ListItem, ListItemIcon, ListItemText, Paper } from '@mui/material';
import { 
  Extension as PlaygroundIcon,
  History as HistoryIcon,
  Star as StarredIcon,
  Settings as SettingsIcon 
} from '@mui/icons-material';
import { useNavigate, useLocation } from 'react-router-dom';

const navItems = [
  { text: 'Playground', icon: <PlaygroundIcon />, path: '/playground' },
  { text: 'History', icon: <HistoryIcon />, path: '/history' },
  { text: 'Starred', icon: <StarredIcon />, path: '/starred' },
  { text: 'Settings', icon: <SettingsIcon />, path: '/settings' },
];

const Sidebar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  return (
    <Paper
      elevation={0}
      sx={{
        width: 240,
        height: '100vh',
        backgroundColor: '#1a1b1e',
        borderRight: '1px solid rgba(255, 255, 255, 0.1)',
      }}
    >
      <Box sx={{ py: 2 }}>
        <List>
          {navItems.map((item) => (
            <ListItem
              key={item.text}
              button
              selected={location.pathname === item.path}
              onClick={() => navigate(item.path)}
              sx={{
                mb: 1,
                mx: 1,
                borderRadius: 1,
                '&.Mui-selected': {
                  backgroundColor: 'rgba(144, 202, 249, 0.08)',
                  '&:hover': {
                    backgroundColor: 'rgba(144, 202, 249, 0.12)',
                  },
                },
                '&:hover': {
                  backgroundColor: 'rgba(255, 255, 255, 0.05)',
                },
              }}
            >
              <ListItemIcon
                sx={{
                  minWidth: 40,
                  color: location.pathname === item.path ? '#60A5FA' : '#9BA1A6',
                }}
              >
                {item.icon}
              </ListItemIcon>
              <ListItemText
                primary={item.text}
                sx={{
                  '& .MuiListItemText-primary': {
                    color: location.pathname === item.path ? '#FFFFFF' : '#9BA1A6',
                    fontWeight: location.pathname === item.path ? 600 : 400,
                  },
                }}
              />
            </ListItem>
          ))}
        </List>
      </Box>
    </Paper>
  );
};

export default Sidebar;
